import React from "react";
import Cell from "./Cell.js";


class App extends React.Component{

    constructor(props){
        super(props);
        this.state = {
          body: [],
          count:0
        }
      }


      giveOrder(count){
          this.state.body.map(
              player=>{
                  player.rank = count;
                  count++;
              }
          )
      }

    componentDidMount(){
        let count = 0;
        fetch("http://localhost:8000/nba")

            .then(res=>res.json())
            .then(body => {
                this.setState({body})
            })
            .then(giveOrder(count))
            .then(count++);
    }

    render() {
        return (
            <div>
                <table className="ranked_table">
                    <tbody>
                    {this.state.body.map(player => React.createElement(Cell, player))}
                    </tbody>
                </table>
                <button id="vote_btn"><a>RANK</a></button>
            </div>
        );
    }
}
export default App;
